INSERT INTO locacao.locacoes VALUES
	(3, 'Estrela do Lago', 1, 60, 1, '<p>Equipamento altamente seguro com capacidade para <strong>60 passageiros</strong>, com 02 (dois) pisos, totalmente equipado e comandado por 02 (dois) tripulantes capacitados e autorizados pela <strong>Marinha do Brasil</strong>.</p><p><br></p><p>Obedecemos todas as normas de segurança em navegação, como também as <strong>ambientais</strong>. Nossos flutuantes são super confortáveis e oferecem as melhores condições de lazer no lago de Palmas. Acesse as fotos e faça o tour virtual disponível na plataforma do site. </p><p><br></p><p><strong>Observação: É incluso o seguro de vida obrigatório individual que custa R$3,00 por pessoa.</strong></p>', 0, 0, NULL, '', '2020-07-23 20:32:47', '2020-07-24 15:26:58', 20);
